import React from "react";
import "./MultiUser.css";

function MultiUser() {
  const urlArray = window.location.href;
  const handle1 = "",
    handle2 = "";
  let i = 0;

  while (urlArray[i] !== "&") {
    handle2 = handle2 + urlArray[i];
    i--;
  }

  return (
    <div className="multi">
      <h1>I am MultiUser</h1>
    </div>
  );
}

export default MultiUser;
